import styled from 'styled-components';
import bgImg from '../assets/background.png';
import Navbar from '../components/Navbar';

const HomeContainer = styled.div`
  position: relative;
  width: 100vw;
  height: 100vh;
  overflow: hidden;
`;

const BackgroundImage = styled.div`
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  z-index: 0;
  background-image: url(${props => props.bg});
  background-size: cover;
  background-position: center;
`;

const Content = styled.div`
  position: relative;
  z-index: 1;
  width: 100%;
  height: 100%;
  display: flex;
  flex-direction: column;
  align-items: center;
  padding: 32px 0 0 0;
`;

const TopText = styled.div`
  color: #222;
  font-family: Pretendard;
  font-size: 20px;
  font-weight: 600;
  line-height: 140%;
  text-align: left;
  margin-bottom: 24px;
`;

const InfoRow = styled.div`
  display: flex;
  gap: 12px;
  align-items: center;
  margin-bottom: 16px;
`;

const InfoBox = styled.div`
  background: rgba(255,255,255,0.2);
  border-radius: 12px;
  padding: 6px 16px;
  color: #222;
  font-size: 14px;
  font-family: Pretendard;
  font-weight: 500;
`;

const StatusBox = styled(InfoBox)`
  color: #4ecdc4;
  background: rgba(76,205,196,0.12);
`;

const Message = styled.div`
  color: #222;
  font-family: Pretendard;
  font-size: 32px;
  font-weight: 400;
  line-height: 120%;
  margin: 32px 0 0 0;
  text-align: left;
`;

const WeatherSection = styled.div`
  margin-top: 32px;
  display: flex;
  flex-direction: row;
  align-items: flex-end;
  width: 100%;
  justify-content: space-between;
`;

const WeatherIconPlaceholder = styled.div`
  width: 180px;
  height: 120px;
  background: rgba(255,255,255,0.3);
  border-radius: 60px 60px 80px 80px;
  margin-right: 16px;
`;

const TempSection = styled.div`
  display: flex;
  flex-direction: column;
  align-items: flex-end;
  margin-right: 24px;
`;

const Location = styled.div`
  color: #222;
  font-family: Pretendard;
  font-size: 16px;
  font-weight: 500;
  margin-bottom: 4px;
`;

const Temp = styled.div`
  color: #222;
  font-family: Pretendard;
  font-size: 72px;
  font-weight: 600;
  line-height: 1;
`;

const TempRange = styled.div`
  color: #888;
  font-family: Pretendard;
  font-size: 16px;
  font-weight: 400;
`;

const BottomButton = styled.button`
  position: absolute;
  left: 50%;
  bottom: 32px;
  transform: translateX(-50%);
  width: 340px;
  height: 48px;
  border-radius: 24px;
  background: #b3d8f7;
  color: #222;
  font-family: Pretendard;
  font-size: 18px;
  font-weight: 500;
  border: none;
  cursor: pointer;
`;

export default function Home() {
  return (
    <HomeContainer>
      <BackgroundImage bg={bgImg} />
      <Content>
        <TopText>
          햇살이 반가운 날도 있지만,<br />
          비 오는 날엔 느긋해도 괜찮아요.
        </TopText>
        <InfoRow>
          <InfoBox>25.05.15</InfoBox>
          <InfoBox>AM 11:00</InfoBox>
          <StatusBox>보통</StatusBox>
        </InfoRow>
        <Message>
          비가 먼저 나가서<br />
          기다리고 있어요.<br />
          <span style={{fontWeight:600}}>우산 꼭 챙겨서 만나요!</span>
        </Message>
        <WeatherSection>
          <TempSection>
            <Location>안산시 상록구 | 비</Location>
            <Temp>17°</Temp>
            <TempRange>16  20</TempRange>
          </TempSection>
        </WeatherSection>
        <BottomButton>
          오늘의 마음의 색상을 등록해주세요.
        </BottomButton>
      </Content>
      <Navbar />
    </HomeContainer>
  );
}
